INSERT INTO `document_cache_data_blobs` VALUES (1,_binary '  Table style=\'width:100%; border:none; border-spacing:0;\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\r\n\r\n  width:60%    RequirementsGuide  \r\n   Requirements Management  \\\\\r\nRequirements specify what the product  or service  must do for end users. Requirements management  RM  with CodeBeamer enables documenting, analyzing, tracing, prioritizing and agreeing on requirements, and then controlling change and communicating to relevant stakeholders. \\\\ \\\\  How to get started?  \\\\ Completing the steps in  the left side guide gives you an easy to follow introduction  to the Requirements Management process. Finally, continue with studying the resources below for details. \\\\ \\\\\r\n Resources \r\n   Requirements Management with CodeBeamer https://codebeamer.com/cb/wiki/85610 \r\n   Requirements management http://en.wikipedia.org/wiki/Requirements_management   Wikipedia   '),(2,_binary '  Table style=\'border:none; border-spacing:0; width:100%\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\r\n\r\n  width:50%    IssueCountByField title=\'Requirements by Status\' trackerId=\'1313\' field=\'status\'   \\\\\r\n  IssueCountByField title=\'Requirements by Type\' trackerId=\'1313\' field=\'category\'   \\\\\r\n  IssueCountByField title=\'Requirements by Business Value\' trackerId=\'1313\' field=\'priority\'   \\\\\r\n  IssueCountByField title=\'Requirements by Complexity\' trackerId=\'1313\' field=\'severity\'   \\\\\r\n  IssueCountByField title=\'Requirements by Release\' trackerId=\'1313\' field=\'target\'   \\\\\r\n   IssueCountTrends title=\'Requirements: Created vs Completed\' trackerId=\'1313\' period=\'last 10 weeks\'   \\\\\r\n  IssueCountByField title=\'Requirements by Assignee\' trackerId=\'1313\' field=\'assignedto\'   \\\\\r\n  IssueCountByField title=\'Requirements by Submitter\' trackerId=\'1313\' field=\'submitter\'    '),(3,_binary '  Table style=\'width:100%; border:none; border-spacing:0;\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\r\n\r\n  width:60%    TestingGuide  \r\n   QA and Testing  \\\\\r\nThe test management facilities in CodeBeamer enable controlled testing of software, hardware and any kind of product or system. \\\\ \\\\\r\n How to get started?  \\\\\r\nCompleting the steps in  the left side guide gives you an easy to follow introduction  to the testing process. We suggest you to completing those steps first and then continue with studying the resources below for details. \\\\ \\\\\r\n Resources \r\n   Test Management with CodeBeamer https://codebeamer.com/cb/wiki/95044 \r\n   Test management http://en.wikipedia.org/wiki/Test_management   Wikipedia \r\n   Quality assurance http://en.wikipedia.org/wiki/Quality_assurance   Wikipedia   '),(4,_binary '  Table style=\'border:none; border-spacing:0; width:100%\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\r\n\r\n  width:50%    TestCasesByLastRunResult title=\'Last Runs\'   \\\\   RequirementCoverage     Coverage Browser CB:/trackers/coverage/coverage.spr?tracker_id=1313  â†’  \\\\ Analyze test run results by configurations, by releases, or by both.\r\n   TestRunsByTestSet title=\'Test Sets\'   \\\\   TestRunsByConfiguration title=\'Tested Configurations\'   \\\\   TestRunsByAssignee title=\'Testers\'    '),(5,_binary '  Table style=\'border:none; border-spacing:0; width:100%\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\r\n\r\n  width:50%    BurnDownChart   \\\\   VelocityTrends  \r\n   RemainingTimePlugin   \\\\   SprintBreakDownPlugin   \\\\   CurrentVelocityPlugin    '),(6,_binary ' \"id\":\"0573ff45-de28-4b3d-a4dd-54d74ddbdbba\",\"layoutType\":\"single_column\",\"widgets\":   \"attributes\": \"markup\": \"typeName\":\"com.intland.codebeamer.dashboard.component.widgets.common.attribute.TextAttribute\",\"required\":true,\"validationRequired\":false,\"value\":\"%%information\\r\\n You can find information about the usage of codebeamer on  codebeamer Knowledge Base https://codebeamer.com/cb/project/CB  wiki pages. \\r\\n%%\\r\\n\\r\\n%%ad\\r\\n Free Download \\\\\\\\\\r\\nWant to try  codebeamer http://www.intland.com/products/codebeamer/overview/  on your own server?  Download https://intland.com/products/download.html download  it for free and install it in minutes.\\\\\\\\\\r\\nQuestions?  Contact us http://www.intland.com/company/contact/ .\\r\\n%%\\r\\n\\r\\n%%information\\r\\n Welcome  \\\\\\\\\\r\\nThis is the wiki  homepage of \'\'codeBeamer Review Project\'\' . It is visible for all project members. Click \'\'Edit\'\' to customize it:\\r\\n  Remove this block\\r\\n  Add a welcome message\\r\\n  Write up project goals, design, schedule or any kind of project related information\\r\\n  Add links to project resources, pictures or any related content\\r\\n  Add wiki plugins to show recent activity, statistical charts and more\\r\\n  Embed Excel spreadsheets, Google maps or RSS feeds\\r\\n%%\\r\\n\\r\\n  Table style=\'width:100%; border:none; border-spacing:0;\' dataStyle=\'vertical-align:top; padding-right:20px; border:none;\'\\r\\n\\r\\n  width:60%;    ReleaseActivityTrends   \\\\\\\\   ActivityStream        IssueCountTrends    \\\\\\\\   ProjectActivityTrends period=\'Last 30 days\' grouping=\'Daily\'   \\\\\\\\   Members  \\r\\n\\r\\n  \"  ,\"id\":\"widget\",\"color\":null,\"defaultTitleKey\":\"dashboard.wiki.markup.widget.name\",\"headerHidden\":false,\"pinned\":false,\"pinnedLayout\":null,\"savedVersion\":null,\"title\":\"Welcome to codeBeamer Review Project\",\"typeName\":\"com.intland.codebeamer.dashboard.component.widgets.wiki.WikiMarkupWidget\",\"version\":\"1.0.0\"   ,\"typeName\":\"com.intland.codebeamer.dashboard.component.containers.grid.FixedGridLayout\" '),(7,_binary 'Requirements Management:\r\n  Requirements Dashboard \r\n  Requirements Guide \r\n\r\nRequirements:\r\n  TRACKER:1313 \r\n  TRACKER:1397 \r\n\r\nWork Items:\r\n  TRACKER:1636 \r\n  TRACKER:1481 \r\n  TRACKER:1554 \r\n\r\nQA & Test Management:\r\n  QA-Test Dashboard \r\n  QA-Test Guide \r\n\r\nRelease Management:\r\n  Project Roadmap CMDB:1094 \r\n  Release Planner PLANNER:1094 ');
