CREATE DEFINER=`leke`@`%` FUNCTION `get_tracker_field`(p_tracker_id INT, p_field_id INT) RETURNS int
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN	DECLARE v_tracker_id int(11);
DECLARE v_field_obj_id int(11);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_field_obj_id = NULL;
	IF p_field_id > 1000000 AND (((MOD(p_field_id , 1000000)) / 100) -1) >= 0 AND ((MOD(p_field_id , 100)) - 1) >= 0 THEN		SET p_field_id = (((CAST((p_field_id / 1000000) AS UNSIGNED)) * 1000000 )	) + ((MOD(p_field_id,100)));
END IF;
SET v_tracker_id = p_tracker_id;
REPEAT		SELECT o.id INTO v_field_obj_id FROM object o INNER JOIN object_revision r ON r.object_id = o.id AND r.revision = o.revision WHERE o.deleted = 0 AND o.type_id = 25 AND o.parent_id = v_tracker_id AND o.reference_id = p_field_id;
IF v_field_obj_id IS NULL THEN			BEGIN				DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_tracker_id = NULL;
SELECT tt.template_id INTO v_tracker_id FROM task_type tt WHERE tt.id = v_tracker_id;
END;
END IF;
UNTIL v_field_obj_id IS NOT NULL OR v_tracker_id IS NULL END REPEAT;
RETURN v_field_obj_id;
END ;;
DELIMITER ;
