CREATE DEFINER=`leke`@`%` FUNCTION `has_tracker_permission`(tracker_id INT, owner_id INT, uid INT, rid INT, bits INT) RETURNS int
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN		DECLARE tid     INT DEFAULT tracker_id;
DECLARE fid     INT DEFAULT CASE WHEN owner_id = uid THEN 6 ELSE -1 END;
DECLARE toCheck INT DEFAULT bits;
DECLARE ovrload INT DEFAULT NULL;
DECLARE granted INT DEFAULT NULL;
DECLARE result  INT DEFAULT 0;
DECLARE done    INT DEFAULT 0;
DECLARE oap_cursor CURSOR FOR		    SELECT bit_mask, access_perms	          FROM object_access_permission			 WHERE object_id = tid			   AND task_id IS NULL			   AND (role_id = rid OR field_id = fid)	           AND (bit_mask IS NULL OR check_bits(bit_mask, toCheck) != 0);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET granted = NULL;
IF tid IS NOT NULL AND rid IS NOT NULL AND bits IS NOT NULL THEN		    REPEAT				OPEN oap_cursor;
REPEAT					FETCH oap_cursor INTO ovrload, granted;
IF granted IS NOT NULL THEN		                SET result = check_bits(granted, toCheck);
IF result != 0 OR ovrload IS NULL THEN							SET done = 1;
ELSE							SET toCheck = clear_bits(toCheck, ovrload);
IF toCheck = 0 THEN								SET done = 1;
END IF;
END IF;
END IF;
UNTIL done = 1 OR granted IS NULL END REPEAT;
CLOSE oap_cursor;
IF done = 0 THEN					SET tid = next_template_tracker_id(tid);
END IF;
UNTIL done = 1 OR tid IS NULL END REPEAT;
END IF;
RETURN result;
END ;;
DELIMITER ;
