CREATE DEFINER=`leke`@`%` FUNCTION `is_reference_field`(p_task_id INT, p_field_id INT, p_ref_type INT) RETURNS int
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN	DECLARE v_tracker_id int(11);
DECLARE is_ref_field int(1);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET is_ref_field = 0;
	IF p_field_id > 1000000 AND (((MOD(p_field_id , 1000000)) / 100) -1) >= 0 AND ((MOD(p_field_id , 100)) - 1) >= 0 THEN		SET p_field_id = (((CAST((p_field_id / 1000000) AS UNSIGNED)) * 1000000 )	) + ((MOD(p_field_id,100)));
END IF;
SELECT t.type_id INTO v_tracker_id FROM task t WHERE t.id = p_task_id;
REPEAT		SELECT 1 INTO is_ref_field FROM object o INNER JOIN object_revision r ON r.object_id = o.id AND r.revision = o.revision INNER JOIN object_reference_filter f ON f.object_id = o.id AND f.type_id = p_ref_type WHERE o.deleted = 0 AND o.parent_id = v_tracker_id AND o.reference_id = p_field_id LIMIT 1;
IF is_ref_field = 0 THEN			BEGIN				DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_tracker_id = NULL;
SELECT tt.template_id INTO v_tracker_id FROM task_type tt WHERE tt.id = v_tracker_id;
END;
END IF;
UNTIL is_ref_field = 1 OR v_tracker_id IS NULL END REPEAT;
RETURN is_ref_field;
END ;;
