CREATE DEFINER=`leke`@`%` FUNCTION `json_field_value`(json TEXT BINARY, field VARCHAR(80)) RETURNS varchar(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    NO SQL
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN	    DECLARE field_pos INT DEFAULT LOCATE(CONCAT('"', field, '"'), json);
DECLARE end_pos   INT DEFAULT 0;
DECLARE field_val VARCHAR(255) BINARY DEFAULT NULL;
IF field_pos > 0 THEN			SET field_pos = LOCATE(':', json, field_pos + LENGTH(field) + 2);
IF field_pos > 0 THEN				SET end_pos = LOCATE(',', json, field_pos + 1);
IF end_pos = 0 THEN				   SET end_pos = LOCATE('}', json, field_pos + 1);
END IF;
IF end_pos = 0 THEN				   SET end_pos = LENGTH(json) + 1;
END IF;
SET field_val = TRIM(BOTH '"' FROM TRIM(SUBSTR(json, field_pos + 1, end_pos - field_pos - 1)));
END IF;
END IF;
RETURN field_val;
END ;;
DELIMITER ;
