CREATE DEFINER=`leke`@`%` FUNCTION `task_choice_field_value`(tid INT, fid INT) RETURNS varchar(512) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN		DECLARE done INT DEFAULT 0;
DECLARE result VARCHAR(512) BINARY;
DECLARE choice_value VARCHAR(30) BINARY;
DECLARE choice_cursor CURSOR FOR			SELECT task_choice_sort_value(T.type_id, V.label_id, V.choice_id) AS sort_val			  FROM task_field_value V				   INNER JOIN task T ON T.id = V.task_id			 WHERE V.task_id = tid			   AND V.label_id = fid			 ORDER BY sort_val ASC;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
OPEN choice_cursor;
REPEAT			FETCH choice_cursor INTO choice_value;
IF NOT done THEN				SET result = CONCAT(IFNULL(result,''), choice_value);
END IF;
UNTIL done END REPEAT;
CLOSE choice_cursor;
RETURN result;
END ;;
