CREATE DEFINER=`leke`@`%` FUNCTION `task_choice_sort_value`(tid INT, fid INT, cid INT) RETURNS varchar(28) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN		DECLARE pid INT DEFAULT tid;
DECLARE result VARCHAR(28) BINARY DEFAULT NULL;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET pid = next_template_tracker_id(pid);
IF cid IS NOT NULL THEN		    REPEAT				SELECT CONCAT(LPAD(IFNULL(REV.status_id,9999), 4, '0'), RPAD(UPPER(SUBSTR(REV.name, 1, 20)), 20, '_')) INTO result				  FROM object FLD				       INNER JOIN object OPN			                   ON OPN.parent_id = FLD.id			                  AND OPN.type_id = 26			                  AND OPN.reference_id = cid			                  AND OPN.deleted = 0			           INNER JOIN object_revision REV			                   ON REV.object_id = OPN.id			                  AND REV.revision = OPN.revision	             WHERE FLD.parent_id = pid	               AND FLD.type_id = 25	               AND FLD.reference_id = fid	               AND FLD.deleted = 0	             LIMIT 1;
UNTIL result IS NOT NULL OR pid IS NULL END REPEAT;
ELSEIF fid = 7 THEN		    SET result = '0000';
END IF;
RETURN result;
END ;;
