CREATE DEFINER=`leke`@`%` FUNCTION `task_field_value_at`(tid INT, fid INT, rev INT, dflt MEDIUMTEXT) RETURNS mediumtext CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN		DECLARE result MEDIUMTEXT BINARY DEFAULT dflt;
DECLARE changed_rev INT DEFAULT NULL;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET changed_rev = NULL;
SELECT MAX(revision) INTO changed_rev FROM task_field_history USE INDEX (task_field_history_idx) WHERE task_id = tid AND label_id = fid AND revision <= rev;
IF changed_rev IS NOT NULL THEN			SELECT new_value INTO result FROM task_field_history WHERE task_id = tid AND revision = changed_rev AND label_id = fid LIMIT 1;
ELSE			SELECT MIN(revision) INTO changed_rev FROM task_field_history USE INDEX (task_field_history_idx) WHERE task_id = tid AND label_id = fid AND revision > rev;
IF changed_rev IS NOT NULL THEN		 		SELECT old_value INTO result FROM task_field_history WHERE task_id = tid AND revision = changed_rev AND label_id = fid LIMIT 1;
END IF;
END IF;
RETURN result;
END ;;
