CREATE DEFINER=`leke`@`%` FUNCTION `task_ref_field_value`(tid INT, fid INT) RETURNS text CHARSET utf8mb4 COLLATE utf8mb4_general_ci
    READS SQL DATA
    SQL SECURITY INVOKER
BEGIN		DECLARE done INT DEFAULT 0;
DECLARE result TEXT BINARY;
DECLARE name VARCHAR(255) BINARY;
DECLARE name_cursor CURSOR FOR			SELECT UPPER(U.name) AS name			  FROM object_reference A USE INDEX (object_reference_from)			  	   INNER JOIN users U ON U.id = A.to_id			 WHERE A.from_type_id = 9			   AND A.from_id = tid			   AND A.field_id = fid			   AND A.to_type_id = 1			 UNION			SELECT UPPER(R.name) AS name			  FROM object_reference A USE INDEX (object_reference_from)			  	   INNER JOIN acl_role R ON R.id = A.to_id			 WHERE A.from_type_id = 9			   AND A.from_id = tid			   AND A.field_id = fid			   AND A.to_type_id = 13			 UNION			SELECT UPPER(T.summary) AS name			  FROM object_reference A USE INDEX (object_reference_from)			  	   INNER JOIN task T ON T.id = A.to_id			 WHERE A.from_type_id = 9			   AND A.from_id = tid			   AND A.field_id = fid			   AND A.field_id IN (0, 80, 99)			   AND A.to_type_id = 9			 UNION      SELECT UPPER(T.summary) AS name        FROM object_reference A USE INDEX (object_reference_from)             INNER JOIN task T ON T.id = A.to_id             INNER JOIN object O ON O.id = A.assoc_id AND O.deleted = 0       WHERE A.from_type_id = 9         AND A.from_id = tid         AND A.field_id = fid         AND A.field_id NOT IN (0, 80, 99)         AND A.to_type_id = 9			 UNION			SELECT UPPER(P.name) AS name			  FROM object_reference A USE INDEX (object_reference_from)			  	   INNER JOIN existing P ON P.proj_id = A.to_id			 WHERE A.from_type_id = 9			   AND A.from_id = tid			   AND A.field_id = fid			   AND A.to_type_id = 2			 UNION			SELECT UPPER(R.name) AS name			  FROM object_reference A USE INDEX (object_reference_from)			  	   INNER JOIN object O ON O.id = A.to_id			  	   INNER JOIN object_revision R ON R.object_id = O.id AND R.revision = O.revision			 WHERE A.from_type_id = 9			   AND A.from_id = tid			   AND A.field_id = fid			   AND A.to_type_id IN (3, 4, 5, 18)			 ORDER BY 1 ASC;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
OPEN name_cursor;
REPEAT			FETCH name_cursor INTO name;
IF NOT done THEN				SET result = CONCAT(IFNULL(result,''),name);
END IF;
UNTIL done END REPEAT;
CLOSE name_cursor;
RETURN result;
END ;;
