CREATE DEFINER=`leke`@`%` FUNCTION `wiki_link_id`(wiki_link VARCHAR(255)) RETURNS int
    NO SQL
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN    	DECLARE trimmed_link VARCHAR(255) DEFAULT TRIM(LEADING '[' FROM TRIM(TRAILING ']' FROM TRIM(wiki_link)));
DECLARE id_sep_pos INT DEFAULT INSTR(trimmed_link, ':');
IF id_sep_pos > 0 THEN			SET trimmed_link = SUBSTR(trimmed_link, id_sep_pos + 1);
END IF;
RETURN CAST(trimmed_link AS SIGNED INTEGER);
END ;;
